import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter as Route, Switch } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/register"></Route>
        <Route path="/">
          <h1>hola</h1>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
